import Link from 'next/link';
import Nav from '../components/Nav'

const Choice = () => {
    return (
        <div>
        <Nav/>
        <Link href="/movies">
            <a>Watch a Movie</a>
        </Link>
        <Link href="/trails">
            <a>Go for a Hike</a>
        </Link>
        </div>
    )
}

export default Choice;
